(4, '7Day Daily(သတင်းစာ)', 'Update News... News... Health... Education... Technology... Environment... Tourism... Business... Life... Entertainment... Opinion... Politics... Regional... Sports... World News... Cartoon... Videos... Special Reports: Archives back to May 2014. ၂၀၁၅ရွှေးကောက်ပွဲ ၊ သတင်း၊ပညာရေး၊စက်မှူလက်မှူ၊ပတ်ဝန်းကျင်၊ကမ္ဘာလှည့်ခရီးသွား၊မှုးခင်း၊စီးပွားရေး၊ဘဝ၊ဖျော်ဖြေမှူ၊အမြင်၊နိူင်ငံရေး၊ဒေသအလိုက်၊အားကစား၊ကမ္ဘာသတင်း၊ကာတွန်း၊ဗီဒီယိုများ၊ အထူးအစီရင်ခံစာများ\r\nSource/Publisher: \r\n7Day Daily (၇ ရက်နေ့စဉ် သတင်းစာ)\r\nDate Of Entry: \r\n2015-01-23', 1, 13, '0', NULL, '2021-12-05 11:57:44'),
(5, 'Aung San Suu Kyi: Myanmar court sentences ousted leader to four years jail', 'Ousted Myanmar leader Aung San Suu Kyi has been sentenced to four years in prison, the first in a series of verdicts that could jail her for life.\r\n\r\nShe was found guilty on charges of inciting dissent and breaking Covid rules under a natural disasters law.\r\n\r\nMs Suu Kyi faces 11 charges in total, which have been widely condemned as unjust. She has denied all charges.\r\n\r\nShe has been in detention since a military coup in February which toppled her elected civilian government.\r\n\r\nIt is not clear when or if Ms Suu Kyi will be placed in prison. She is being held at an undisclosed location.\r\n\r\nCo-defendant Win Myint, the', 1, 11, '0', NULL, '2021-12-06 11:07:41'),
(6, 'Nagaland: Indian state tense after killing of 14 civilians', 'Tensions prevail in the restive north-eastern Indian state of Nagaland following the killing of 14 civilians by soldiers.\r\n\r\nAuthorities have shut down internet services and imposed a curfew to quell mass protests.\r\n\r\nViolence started on Saturday when an army patrol in Mon district mistook a group of labourers for militants and opened fire, killing six.\r\n\r\nThe army called it a \"case of mistaken identity\" but locals reject the claim.', 1, 11, '0', NULL, '2021-12-06 11:15:39'),
(7, 'Covid disruption caused 47,000 more malaria deaths in 2020 - WHO', 'The World Health Organization says 2020 saw more malaria cases and more deaths, because of disruption to prevention and treatment caused by the pandemic.\r\n\r\nIn its annual World Malaria Report, the WHO said there were 14 million more cases of malaria in 2020 than a year earlier, and 69,000 more deaths.\r\n\r\nCovid has put pressure on health systems worldwide. In countries where malaria is endemic, lockdowns delayed deliveries of mosquito nets, some patients missed out on treatment because they could not travel.\r\n\r\nThe WHO estimates that two-thirds, or 47,000, of the additional malaria deaths in 2020 were linked to the pandemic’s disruption of malaria prevention and treatment.', 1, 11, '0', NULL, '2021-12-06 11:16:17'),
(8, 'No jab, no cinema: Iople', 'Italy has beefed up its measures to curb a wave of Covid infections by introducing new rules that target unvaccinated people.\r\n\r\nOnly those who have been vaccinated or recently recovered from Covid will be allowed to go to the theatre, cinemas, live music venues and major sporting events.\r\n\r\nA so-called Covid green pass, which shows proof of vaccination, will now be required to use hotels and local public transport as well.\r\n\r\nThe measures came into effect today and will remain in place until at least the middle of next month. Infection rates have been rising gradually in Italy since mid-October.', 1, 13, '0', NULL, '2021-12-06 11:16:55'),
(10, ' ရန်ကုန်တိုင်းဒေသကြီး၊ ကြည့်မြင်တိုင်မြို့နယ်၊ ပန်းပင်ကြီးလမ်းပေါ်တွင် ကျူးလွန်ခဲ့သည့် အကြမ်းဖက်စစ်ကောင်စီတပ်ဖွဲ့ဝင်များ၏ လူမဆန်သော အကြမ်းဖက်လုပ်ရပ်များနှင့် စပ်လျဉ်း၍ သဘောထားထုတ်ပြန်ခြင်း', '\r\n\"၁။ ၂၀၂၁ ခုနှစ် ဒီဇင်ဘာလ ၅ ရက်နေ့၊ ယနေ့နံနက် ၈နာရီဝန်းကျင်တွင် ရန်ကုန်တိုင်းဒေသကြီး၊ ကြည့်မြင်တိုင်မြို့နယ်၊ ပန်းပင်ကြီးလမ်းပေါ်၌ ငြိမ်းချမ်းစွာဆန္ဒပြချီတက်လာသော စစ်အာဏာရှင် ဆန့်ကျင်ရေးသပိတ်စစ်ကြောင်းကို အကြမ်းဖက်စစ်ကောင်စီတပ်ဖွဲ့ဝင်များက လူမဆန်စွာကားဖြင့် ဝင်တိုက်ပြီး ပစ်ခတ်ဖြိုခွင်းခဲ့ခြင်းကြောင့် ဆန္ဒပြလူငယ် ၅ ဦးသေဆုံးခဲ့ပြီး အနည်းဆုံး ၁၅ ဦးခန့် ဖမ်းဆီး ထိန်းသိမ်းခံခဲ့ရပါသည်။ ၂။ အဆိုပါအကြမ်းဖက်မှု၌ အများအပြားပြင်းထန်သော ဒဏ်ရာရရှိခဲ့ပြီး ရိုက်နှက်ခြင်း၊ ခြေထောက် ဖြင့် ကန်ကျောက်ခြင်း၊ သေနတ်ဒင်ဖြင့် ရိုက်နှက်ခြင်းများ ပြုလုပ်ခဲ့သည့်အပြင် ဆေးကုသခွင့် မရရှိဘဲ စစ်ကြောရေးစခန်းများသို့ ဖမ်းဆီး ခေါ်ဆောင်သွားခဲ့သည့် လူမဆန်သော ဖြစ်စဉ်နှင့်ပတ်သက်၍ ပြည်သူလူထု တစ်ရပ်လုံးနှင့်ထပ်တူ များစွာဝမ်းနည်းကြေကွဲရပါသည်။ ၃။ လွတ်လပ်စွာစုဝေးခွင့်၊ လွတ်လပ်စွာ ဆန္ဒထုတ်ဖော်ခွင့်တို့သည် နိုင်ငံသားတို့၏ အခြေခံအခွင့် အရေးတစ်ရပ်ဖြစ်ပြီး ယခုကဲ့သို့ အပြစ်မဲ့သော ငြိမ်းချမ်းစွာ ဆန္ဒပြသူများအား ရည်ရွယ်ချက်ရှိရှိ အကြမ်းဖက် ဆောင်ရွက်နေခြင်းသည် အပြည်ပြည်ဆိုင်ရာ လူ့အခွင့်အရေးကြေညာစာတမ်း (Universal Declaration of Human Rights) ပါ ပြဌာန်းချက်များကို လိုက်နာမှုမရှိဘဲ ပြောင်ပြောင်တင်းတင်း ချိုးဖောက်နေခြင်း ဖြစ်ပါသည်။ ၄။ ယခုကဲ့သို့သော လူမဆန်သော ရာဇဝတ်မှုများကို နေ့စဉ်ရက်ဆက် ကျူးလွန်နေကြသည့် အကြမ်းဖက်စစ်ကောင်စီနှင့်လက်ပါးစေများအား ပြင်းပြင်းထန်ထန် ရှုံ့ချပါကြောင်းနှင့် ၎င်းတို့အား သံတမန်ရေးနည်းလမ်းအပါအဝင် လိုအပ်သည့် အရေးယူဆောင်ရွက်မှုများပြုလုပ်နိုင်ရေး ပြည်ထောင်စု လွှတ်တော်ကိုယ်စားပြုကော်မတီအနေဖြင့် နိုင်ငံတကာအသိုက်အဝန်းနှင့် ဆက်သွယ်ဆောင်ရွက်လျက် ရှိပါကြောင်း သဘောထားထုတ်ပြန်အပ်ပါသည်။ ပြည်ထောင်စုလွှတ်တော်ကိုယ်စားပြုကော်မတီ...\"\r\nSource/Publisher: \r\nCommittee Representing Pyidaungsu Hluttaw (CRPH)', 1, 11, '0', NULL, '2021-12-06 15:13:49'),
(11, ' Senior NLD Official, Prominent Myanmar Comedian Freed Alongside Activists, Journalists', '\r\n\"A National League for Democracy (NLD) official and other party members, around a dozen journalists, student activists, a writer, a comedian and a few striking civil servants were among those released under Monday’s amnesty order. Coup leader Min Aung Hlaing on Monday announced the regime’s decision to free over 1,300 people jailed for participating in anti-coup protests and more than 4,300 detainees who were facing trial on incitement charges for their anti-regime activism. The amnesty followed an announcement by ASEAN that Min Aung Hlaing would not be invited to its annual summit later this month after the regional bloc’s call to end the ongoing violence in Myanmar in April was ignored. NLD information secretary released Monywa Aung Shin’s wife, Daw Kay Thwe Moe, told The Irrawaddy the detained politician returned to the family on Monday evening. Monywa Aung Shin was arrested by regime forces at his home in Yangon’s Tamwe Township at around 4:30 a.m. on Feb. 1, the day the junta overthrew the democratically elected NLD-led government. He was one of around 150 senior NLD leaders and Central Executive Committee members, prominent activists, writers and monks who were arrested on the first day of the coup. Since then, the whereabouts and condition of the 76-year-old politician had remained unknown to the family until his release. In an interview with local media outlet DVB news, Monywa Aung Shin said he was kept at a military interrogation center in Mingalardon Township and no charge was filed against him, despite his being detained for over eight months. Several NLD members and elected lawmakers remain in detention. And some of those who were included on the release list on Monday were rearrested for allegedly having connections with the parallel National Unity Government, its parliamentary committee and the People’s Defense Force, according to sources. The junta has brought several charges, from bribery to incitement, against NLD leaders including State Counselor Daw Aung San Suu Kyi, President U Win Myint, chief ministers and the party’s elected parliamentary speakers. Some journalists freed As of late Tuesday afternoon, the release of around a dozen journalists had been', 1, 11, '0', NULL, '2021-12-06 15:14:30'),
(12, 'The Global New Light of Myanmnar\" Saturday 23 December, 2017', '\r\nDOMESTIC NEWS: Freezing temperatures hit hilly areas...Disaster preparedness for states and regions...Vice President U Myint Swe attends coord meeting to hold 2018 Union Day...Notification of disbursement of loan to SMEs...President U Htin Kyaw and First Lady attend Christmas ceremony...Poultry farmers face difficulties with rising price of poultry feed...Fire breaks out in three Yangon townships...Fire outbreaks decline this year but losses are high...No injuries in Hopong Town kitchen fire...Disaster preparedness for states and regions...Muse police searching for Myo Ma Pawn Shop attackers...Establishment of Kanyinchaung Economic Zone in Maungtaw tsp...Enjoying peace and stability in Mro ethnic villages...Murder, theft cases in Maungtaw and Buthidaung...Cash donation ceremony held in Rakhine State...Myanmar Investment Commission Meeting 17/2017...One attacker and three suspects arrested in Maungtaw, Rakhine... Eight teams to compete in KBZ Bank Women?s League 2017-2018.....EXTERNAL RELATIONS: President U Htin Kyaw accepts credentials of Ambassador of Peru...President U Htin Kyaw accepts credentials from Ambassador of Ukraine...Border exports of watermelon to China increase........External trade with international countries tops $22.6 billion in current FY...About 700 tonnes of condensed milk imported in early December...Tourists visit Myanmar via Tachilek border gate...China increases imports of rice, corn, vehicle fuel against last year...Myanmar secures bronze in Than Nien Cup by defeating Thailand.....\"OPINION\": \"One who knows nothing can understand nothing\".....ARTICLE: \"Protection for Southeast Asia?s Rarest Wildlife through Community Engagement\" - By Maung Aung Mon\r\nSource/Publisher: \r\nThe Global New Light of Myanmnar', 1, 11, '0', NULL, '2021-12-06 15:15:16'),
(13, ' \"The New Light of Myanmar \" 29 December 2008', '\r\nSenior General Than Shwe on inspection tour of Delta Local people themselves to put more efforts into rehabilitation and reconstruction tasks NAY PYI TAW, 28 Dec-Chairman of the State Peace and Development Council Commander-in-Chief of Defence Services Senior General Than Shwe, accompanied by member of SPDC General Thura Shwe Mann, Chairman of Natural Disaster Preparedness Central Committee Prime Minister General Thein Sein, member of SPDC Lt-Gen Tin Aye, Commander-in-Chief (Navy) Rear-Admiral Nyan Tun, Commander-in-Chief (Air) Lt-Gen Myat Hein, Maj-Gen Ko Ko and Lt-Gen Myint Swe of the Ministry of Defence, Adjutant-General Lt-Gen Thura Myint Aung, Lt-Gen Myint Hlaing of the Ministry of Defence, members of Natural Disaster Preparedness Central Committee ministers, senior military officers of the Ministry of Defence, the deputy ministers, the director-general of the Government Office and officials of the State Peace and Development Council Office, arrived at Pyapon by helicopter at 9.45 a.m. yesterday.[ more + ] Throughout history, Myanmar has existed in the world with her own literature, culture, customs and traditions Secretary-1 addresses ceremony to present Life-time Achievement National Literary Award, National Literary Award and Sarpay Beikman Manuscript Award NAY PYI TAW, 28 Dec -A ceremony to present Life-time Achievement National Literary Award, National Literary Award and Sarpay Beikman Manuscript Award took place at the Ministry of Information here with an address by Secretary-1 of the State Peace and Development Council Lt-Gen Thiha Thura Tin Aung Myint Oo. [ more + ] Winner to receive Life-time', 1, 11, '0', NULL, '2021-12-06 15:15:53'),
(15, 'The Constitution of the United States', '\"The United States Constitution is the supreme law of the United States. The Constitution, originally comprising seven articles, delineates the national frame of government. Its first three articles embody the doctrine of the separation of powers, whereby the federal government is divided into three branches: the legislative, consisting of the bicameral Congress; the executive, consisting of the President; and the judicial, consisting of the Supreme Court and other federal courts. Articles Four, Five and Six embody concepts of federalism, describing the rights and responsibilities of state governments and of the states in relationship to the federal government. Article Seven establishes the procedure subsequently used by the thirteen States to ratify it. It is regarded as the oldest written and codified national constitution in force. Since the Constitution came into force in 1789, it has been amended 27 times, including an amendment to repeal a previous one, in order to meet the changing needs of a nation that has profoundly changed since the eighteenth century. In general, the first ten amendments, known collectively as the Bill of Rights, offer specific protections of individual liberty and justice and place restrictions on the powers of government. The majority of the seventeen later amendments expand individual civil rights protections. Others address issues related to federal authority or modify government processes and procedures. Amendments to the United States Constitution, unlike ones made to many constitutions worldwide, are appended to the document. All four pages of the original U.S. Constitution are written on parchment...\" (Wikipedia)\r\nSource/Publisher: \r\nUnited States of America', 1, 11, '0', NULL, '2021-12-06 15:18:36'),
(16, 'The Constitution Of The United States Bill of Rights & All Amendments', 'A highly accessible, easy-to-use online version full-text transcript of the US Constitution including Bill of Rights and the 27 Amendments.\r\n\r\nAlternatively, download the free US Constitution PDF version.\r\n\r\nThis text of the US Constitution follows the engrossed copy signed by Gen. Washington and the deputies from 12 States. The Arabic numerals preceding the paragraphs designate Clauses, and were not printed (but are referred to) in the original.\r\n\r\nPreamble to the US Constitution\r\nThe preamble to the US Constitution starts off with the famous words “We the People”. \r\n\r\nFind out exactly why these words We the People were used and what their significance is.', 1, 11, '0', NULL, '2021-12-06 15:19:02'),
(19, 'COP26: Rich nations &lsquo;resisting paying for climate loss&rsquo;', 'Urgent steps must be taken to change the &ldquo;toxic&rdquo; tone of negotiations relating to the irreversible impacts of climate change, science and civil society leaders have told political leaders at COP26.\r\n\r\nDelegates say wealthy countries have been digging in their heels against calls from climate-impacted countries for financial support to both avoid and address loss and damage.\r\n\r\nThe term &lsquo;loss and damage&rsquo; relates to irreversible climate change impacts that can no longer be adapted to or mitigated against, usually associated with extreme weather events such as floods, droughts and wildfires.', 2, 11, '0', NULL, '2021-12-07 21:10:00'),
(20, '&ldquo;Unfortunately, negotiations get stuck in toxic issues of liability and compensation. We need to think about humanity. That&rsquo;s what we&rsquo;re asking for here and we&rsquo;re not getting much in return.&rdquo;', 'Non-government climate leaders have said that climate finance, particularly for loss and damage, is among the most important issues for developing countries to be discussed at the climate summit.\r\n\r\nBut some say that the space to thrash out the problem has been restricted, with loss and damage talks being pushed to the sidelines.\r\n\r\nHundreds of people crowded the halls within the COP26 Blue Zone on Monday in an effort to join a loss and damage meeting hosted by the COP presidency and the Red Cross Red Crescent Climate Centre, but many were turned away when the room reached capacity.\r\n\r\nSaleemul Huq, the director of the International Centre for Climate Change and Development (ICCCAD) in Bangladesh, said loss and damage talks needed to appeal to the hearts and humanity of negotiators.\r\n\r\n&ldquo;Unfortunately, negotiations get stuck in toxic issues of liability and compensation,&rdquo; Huq told the presidency meeting. &ldquo;We need to think about humanity. That&rsquo;s what we&rsquo;re asking for here and we&rsquo;re not getting much in return.&rdquo;\r\n\r\nScotland&rsquo;s government last week pledged &pound;1 million (US$1.36 million) for loss and damage, supporting a partnership with the US-based Climate Justice Resilience Fund to help communities rebuild from climate-related event', 2, 11, '0', NULL, '2021-12-07 21:10:23'),
(21, 'Climate action needed to avert &lsquo;health catastrophe&rsquo;', 'By: Sanjeet Bagcchi\r\n \r\nTo achieve sustained recovery from the COVID-19 pandemic and avoid an &ldquo;impending health catastrophe&rdquo;, countries must commit to targeted action on climate change, health experts have urged ahead of the UN climate summit, COP26.\r\n\r\nAn open letter signed by more than 450 organisations representing 45 million health workers called on national leaders and country delegations at COP26 in Glasgow next month to put &ldquo;human health and equity&rdquo; at the centre of climate change mitigation and adaptation actions. The list of signatories represents more than two thirds of the global health workforce, according to the World Health Organization (WHO).\r\n\r\nThe WHO&rsquo;s COP26 Special Report on Climate Change and Health, The Health Argument for Climate Action, launched at the same time as the letter, outlined 10 recommendations for governments to &ldquo;maximise t', 2, 11, '0', NULL, '2021-12-07 21:10:50'),
(22, 'How ', 'Lebanon has been reeling under an ongoing economic crisis.\r\n', 1, 13, '0', NULL, '2021-12-05 11:55:24'),
