(45, 'Leaked letter suggests Boris Johnson backed dog and cat airlift from Kabul as Afghans sought refuge', 'British Prime Minister Boris Johnson on Tuesday called allegations that he had intervened to help airlift nearly 200 dogs and cats from Kabul during the Afghanistan withdrawal crisis &ldquo;complete nonsense.&rdquo;\r\n\r\nBut the same day, a senior opposition lawmaker produced a letter from a top Johnson aide that &ldquo;authorized&rdquo; the animal evacuation. Chris Bryant, the lawmaker, also accused Downing Street of &ldquo;covering up&rdquo; the prime minister&rsquo;s role in that operation, which took place as thousands of vulnerable Afghans scrambled to flee Taliban rule.\r\n\r\nAt the height of the crisis, Paul &ldquo;Pen&rdquo; Farthing, a former British Royal Marine who operated the Nowzad animal charity, pushed a high-profile social media campaign to get British and Taliban officials to give his staff and animals safe passage to the Kabul airport. Farthing eventually arrived in London on Aug. 29 on a privately chartered flight with his animals, but no staff. (Nowzad personnel later managed to flee, Farthing said.)', 1, 17, '0', NULL, '2021-12-08 11:18:54'),
(46, 'disabled', 'Disabled\r\nAdd the disabled attribute and the associated &lt;label&gt;s are automatically styled to match with a lighter color to help indicate the input&rsquo;s state.', 1, 12, '0', NULL, '2021-12-08 11:29:31'),
