(50, 'အဆုတ်ကို သန့်စင်ပေးနိုင်တဲ့အစားအစာတွေကဘာတွေဖြစ်မလဲ', '&lt;p&gt;&lt;span style=&quot;box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline;&quot;&gt;ပန်းသီး&lt;/span&gt;&lt;br style=&quot;box-sizing: inherit;&quot;&gt;ပန်းသီးကမြန်မာလူမျိုးတွေအတွက် အသင့်တော်ဆုံးအသီးတစ်မျိုးလည်းဖြစ်သလို အလွယ်တကူ၀ယ်ယူလို့ရတဲ့အသီးတစ်မျိုးပါ။အမျှင်ဓာတ်နဲ့ Vitamin ဓာတ်တွေပါ၀င်တဲ့အတွက်အဆုတ်ကိုအားကောင်းစေပြီး သန့်စင်ပေးနိုင်တဲ့အသီးတစ်မျိုးဖြစ်ပါတယ်။ဆရာ၀န်တွေရဲ့ပြောကြားချက်အရ အခုလိုအချိန်မျိုးမှာ တစ်နေ့တစ်လုံးစားပေးသင့်ပါတယ်။&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;data:image/png;base64,&quot; style=&quot;width: 100%;&quot; data-filename=&quot;image-17.png&quot;&gt;&lt;br&gt;&lt;/p&gt;', 1, 13, '0', NULL, '2021-12-08 12:32:08');
