(55, 'ရှားစောင်းလက်ပတ်အပင်က လူ့ပတ်၀န်းကျင်မှာဆိုရင်တော့ မရှိမဖြစ်အပင်တစ်မျိုးလို့တောင်ပြောလို့ရပါတယ်', '&lt;p&gt;&lt;span style=&quot;box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; vertical-align: baseline;&quot;&gt;ရှားစောင်းလက်ပတ် (Aloe Vera )&lt;/span&gt;&lt;br style=&quot;box-sizing: inherit;&quot;&gt;ရှားစောင်းလက်ပတ်အပင်က လူ့ပတ်၀န်းကျင်မှာဆိုရင်တော့ မရှိမဖြစ်အပင်တစ်မျိုးလို့တောင်ပြောလို့ရပါတယ်။ အောက်ဆီဂျင်ထုတ်ပေးနိုင်တဲ့အပြင် အလှအပ အရေးအရာအတွက်ဆိုလည်းမရှိမဖြစ်ပါနော်။အရမ်းလည်းဂရုစိုက်စရာမလိုသလို ရေလည်းအများကြီးလောင်းပေးစရာလည်းမလိုပါဘူးနော်။&lt;/p&gt;&lt;p&gt;&lt;img src=&quot;data:image/jpeg;base64,&quot; style=&quot;width: 100%;&quot; data-filename=&quot;download (1).jfif&quot;&gt;&lt;br&gt;&lt;/p&gt;', 1, 13, '0', NULL, '2021-12-08 13:03:57');
